import imagen from './img/reyes/sisebuto.png';
import imagen1 from './img/reyes/leovigildo.png';
import imagen2 from './img/reyes/atanagildo.png';
import './App.css';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <div className='imagenes'>
          <img src={imagen} alt="sisebuto"/>
        </div>
      </header>
    </div>
  );
}
export default App;
